import BootstrapTable from 'react-bootstrap-table-next';
import React from 'react';

const products = [];

const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];

class Example extends React.Component() {

render(){    

return(<BootstrapTable keyField='id' data={ products } columns={ columns } />);

}
};

export default Example;
